import React from 'react';
import './App.css';

class App extends React.Component {
  constructor(){
    super()
    this.state = {
      character: {}
    }
  }

  componentDidMount(){
    fetch("https://swapi.co/api/people/1")
      .then(response => response.json())
      .then(data => {
        this.setState({character: data})
      })
  }

  render() {
    return (
      <div>
        <div>
        <h1>Title Bout App</h1>
      </div>
      <div>
        {this.state.character.name}
      </div>
      </div>

    )
  }

}

export default App;
